import "./styles.css";

import React from 'react';
import { Card, Button } from 'react-bootstrap';

const HorizonCard = () => {
  return (
    <Card className="gradient">
      <Card.Body className="text-end">
        <Card.Title className="text-start">Discover a New Horizon in Browsing</Card.Title>
          <Button  variant="primary">Download Now</Button>
        <Card.Text className="text-start">
          With Horizon, you can experience the web like never before. Our lightning-fast browser is designed to help you explore, discover, and connect with ease.
            
        </Card.Text>
        
      </Card.Body>
    </Card>
  );
};

export default HorizonCard;
